import React, { Component } from 'react';
import ProgressBar from './ProgressBar';

class Languages extends Component {
state = {
    languages: [
        { id: 1, name: 'JavaScript', xp: 0.6 },
        { id: 2, name: 'Php', xp: 1 },
        { id: 3, name: 'HTML/CSS', xp: 1 },
        { id: 4, name: 'SQL', xp: 1 },
    ],
    frameworks: [
        { id: 1, name: 'React', xp: 1 },
        { id: 2, name: 'Laravel', xp: 1 },
        { id: 3, name: 'Sass', xp: 1 },
        { id: 4, name: 'NodeJS/Express', xp: 1 },
    ]
}

    render() {
        let { languages, frameworks } = this.state;

        return (
            <div>
                <div className="languagesframeworks">
                    <ProgressBar
                        languages={languages}
                        className="LanguagesDisplay"
                        title="Languages"
                    />
                    <ProgressBar
                        languages={frameworks}
                        className="FrameworksDisplay"
                        title="Frameworks"
                    />
                </div>
            </div>
        );
    }
}

export default Languages;
